def And_gate(x1, x2):
    w1 = 0.5 
    w2 = 0.5
    b = -0.7

    result = w1 * x1 + w2 * x2 + b
    if result <=0:
        return 0
    else:
        return 1


# In[ ]:


print(And_gate(0,0),And_gate(0,1),And_gate(1,0),And_gate(1,1))


